let InteractedInstance = null;
module.exports = class interacted {

    constructor() {
        if (!InteractedInstance) {
            InteractedInstance = this;
            //set all other default values

            this.displayAs = 'Interacted';
            this.value = 'interacted'
            this.type = 'TOGGLE';
            this.values = {'true-value':'true', 'false-value': 'false'}
        }
        return InteractedInstance;
    }
}